import React, { useEffect, useState } from 'react';

const DhanStatus = () => {
  const [status, setStatus] = useState<any>(null);

  useEffect(() => {
    fetch(process.env.REACT_APP_API_URL + '/api/dhan/status')
      .then(res => res.json())
      .then(setStatus)
      .catch(() => setStatus({ connected: false, last_event: null, error: 'Unable to connect to backend' }));
  }, []);

  return (
    <section>
      <h2>Dhan Connection Status</h2>
      {status ? (
        <div>
          <p>Connected: {status.connected ? 'Yes' : 'No'}</p>
          <pre>{JSON.stringify(status.last_event, null, 2)}</pre>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </section>
  );
};

export default DhanStatus;
